import React from "react";
import { Divider } from "antd";
import startupscreen from "./startupscreen.png";

const CodeTDetail = () => (
    <div>
        <h1>Code-T</h1>
        <Divider />
        <img src={startupscreen} alt="Code-T In-Game Screenshot"/>
        <p>
            Code-T is a multiplayer shooter game that is developed by Tian Yang and me.
            The game supports game modes including Team Death Match, Objectives Domination,
            and PVE.
        </p>
    </div>);

export default CodeTDetail;
